class kruskal {
  public $per;//记录父节点
  public $rank;//记录树的深度

  //初始化n个节点 
  public function init($n) {
    for($i=1;$i<=$n;$i++) {
	$this->per[$i] = $i;
	$this->rank[$i] = 0;
    }
  }
  //找到根节点，压缩路径  
  public function find($x){      
    if($x == $this->per[$x])          
        return $x;      
    return $this->per[$x] = $this->find($this->per[$x]);  
  }  
  //合并
  public function union($a, $b){    
    $fa = $this->find($a);    
    $fb = $this->find($b);    
    if($fb != $fa){    
        if($this->rank[$fa]  < $this->rank[$fb]){    
            $this->per[$fa] = $fb;    
        }    
        else{    
            $this->per[$fb] = $fa;    
            if($this->rank[$fa] == $this->rank[$fb])
		$this->rank[$fa]++;    
        } 

      return true;   
    }

    return false;      
  }

  //主程序
  public function run($line){
      $this->per = [];
      $this->rank = [];
    $lines = explode(';', $line);
    $city = $lines[0];//城市数
    $roads = [];//连接路
    $price = 0;//最小价值
    $rnum = 0;//连通路数量
    $temp = array_slice($lines, 1);
    foreach($temp as $key=>$value) {
      $roads[] = explode(',', $value);
    }
    foreach($roads as $key=>$value) {
      $prices[$key] = $value[2];
    }
    array_multisort($prices, SORT_ASC, $roads);

    $this->init($city);
    foreach($roads as $road) {
      $link = $this->union($road[0], $road[1]);
      if($link) {
        $price = $price + $road[2];
        $rnum = $rnum + 1;
        if($rnum == ($city-1)) {
          break;
        }
      }
    }

    //var_dump($roads);
    return $price;
  } 

}

  function getMillisecond() {
        list($t1, $t2) = explode(' ', microtime());
        return (float)sprintf('%.0f',(floatval($t1)+floatval($t2))*1000);
  }

